function Main() {
  return (
    <div>
      <h1 style={{ textAlign: "center" }}>Use Cases</h1>
      <p style={{ textAlign: "center", padding: "0px 200px" }}>
        Education and entertainment companies use our technology to give kids
        voice-enabled play and learning experiences that are engaging, accurate
        and private.
      </p>
      <div
        container
        style={{ display: "flex", flexWrap: "wrap", padding: "50px 50px" }}
      >
        <Grid sm={4} xs={12}></Grid>
      </div>
    </div>
  );
}

export default Main;
